import { Box, Container } from "@material-ui/core";
import styled from "styled-components";

const App = () => {
  return (
    <Box>
      <Container maxWidth={"xs"}>
        <BoxStlyed>Content</BoxStlyed>
      </Container>
    </Box>
  );
};

const BoxStlyed = styled(Box)`
  height: 100vh; 
  display: flex; 
  alignItems: center; 
  justifyContent: center;
`;

export default App;
